import React from 'react';
import { Container, Typography, Box, Card, CardMedia, CardContent, Button, Grid } from '@mui/material';
import { useNavigate } from 'react-router-dom';
import floatProduct from '../assets/float-product.jpg';

const Products = () => {
  const navigate = useNavigate();

  const handleAddToCart = () => {
    navigate('/cart');
  };

  return (
    <Container maxWidth="lg" sx={{ my: 4 }}>
      <Typography variant="h1" component="h1" align="center" gutterBottom>
        Premium Aqua Float
      </Typography>
      <Typography variant="h5" align="center" color="textSecondary" paragraph>
        Our premium float product designed for ultimate comfort and style
      </Typography>

      <Grid container spacing={4} sx={{ mt: 4 }}>
        <Grid item xs={12} md={7}>
          <Card
            sx={{
              height: '100%',
              display: 'flex',
              alignItems: 'center',
              justifyContent: 'center'
            }}
          >
            <CardMedia
              component="img"
              height="600"
              image={floatProduct}
              alt="Premium Aqua Float"
              sx={{ 
                objectFit: 'contain',
                padding: '1rem',
                borderRadius: '8px',
                boxShadow: '0 4px 20px rgba(0, 0, 0, 0.1)',
                transition: 'transform 0.3s ease',
                '&:hover': {
                  transform: 'scale(1.02)',
                }
              }}
            />
          </Card>
        </Grid>
        <Grid item xs={12} md={5}>
          <Card
            sx={{
              height: '100%',
              display: 'flex',
              flexDirection: 'column',
              justifyContent: 'space-between'
            }}
          >
            <CardContent
              sx={{
                display: 'flex',
                flexDirection: 'column',
                justifyContent: 'space-between',
                height: '100%',
                p: 4
              }}
            >
              <Box>
                <Typography variant="h2" gutterBottom>
                  Premium Aqua Float
                </Typography>
                <Typography variant="h3" color="primary" gutterBottom>
                  $199.99
                </Typography>
                <Typography variant="body1" paragraph>
                  Experience ultimate comfort and style with our premium aqua float. 
                  Designed with the highest quality materials for maximum relaxation 
                  and durability. Perfect for any water activity - from pool relaxation 
                  to ocean adventures.
                </Typography>
                <Box sx={{ display: 'flex', flexDirection: 'column', gap: 2, mt: 2 }}>
                  <Typography variant="h6">
                    <strong>Features:</strong>
                  </Typography>
                  <Typography variant="body1">
                    <strong>• Material:</strong> Premium PVC
                  </Typography>
                  <Typography variant="body1">
                    <strong>• Size:</strong> 180cm x 80cm
                  </Typography>
                  <Typography variant="body1">
                    <strong>• Weight:</strong> 1.5kg
                  </Typography>
                  <Typography variant="body1">
                    <strong>• Max Weight Capacity:</strong> 150kg
                  </Typography>
                </Box>
              </Box>
              <Box sx={{ mt: 'auto' }}>
                <Button
                  variant="contained"
                  color="primary"
                  size="large"
                  onClick={handleAddToCart}
                  sx={{
                    mt: 2,
                    width: '100%',
                    boxShadow: '0 4px 20px rgba(0, 0, 0, 0.1)',
                    '&:hover': {
                      boxShadow: '0 8px 40px rgba(0, 0, 0, 0.15)'
                    }
                  }}
                >
                  Add to Cart
                </Button>
              </Box>
            </CardContent>
          </Card>
        </Grid>
      </Grid>
    </Container>
  );
};

export default Products;
